import './App.css';

class Heading extends React.Component {
  render() {
    return <h2>Hi, I am a Heading!</h2>;
  }
}

function App() {
  return (
    <div className="App">
        <Heading />
        <p>
          Welcome to my React app!
        </p>
    </div>
  );
}

export default App;
